        return new Source("{% extends 'base.html.twig' %}

{% block title %}Profile index{% endblock %}

{% block body %}
    <h1>Profile index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>LastName</th>
                <th>FirstName</th>
                <th>Address</th>
                <th>Address2</th>
                <th>Zipcode</th>
                <th>City</th>
                <th>Date de création</th>
                <th>Statut</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for profile in profiles %}
            <tr>
                <td>{{ profile.id }}</td>
                <td>{{ profile.lastName }}</td>
                <td>{{ profile.firstName }}</td>
                <td>{{ profile.address }}</td>
                <td>{{ profile.address2 }}</td>
                <td>{{ profile.zipcode }}</td>
                <td>{{ profile.city }}</td>
                <td>{{ profile.updatedAt ? profile.updatedAt|date('Y-m-d H:i:s') : '' }}</td>
                {% if profile.status %}
                    <td>{{ profile.status.name }}</td>
                {% else %}
                    <td class=\"fst-italic\">Statut non-renseigné</td>
                {% endif %}
                <td>
                    <a href=\"{{ path('admin_profile_show', {'id': profile.id}) }}\">show</a>
                    <a href=\"{{ path('admin_profile_edit', {'id': profile.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"9\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

{% endblock %}
", "admin/user/profile/profiles.html.twig", "C:\\Users\\magau\\OneDrive\\Documents\\GitHub\\trioenologie\\templates\\admin\\user\\profile\\profiles.html.twig");
